create table quests_objectives
(
    Id                     int auto_increment
        primary key,
    StepId                 int        not null,
    TypeId                 int        not null,
    DialogId               int        not null,
    ParametersCSV          mediumtext null,
    Parameter0             int        not null,
    Parameter1             int        not null,
    Parameter2             int        not null,
    Parameter3             int        not null,
    Parameter4             int        not null,
    DungeonOnly            tinyint    not null,
    CoordsX                int        not null,
    CoordsY                int        not null,
    TriggeredByObjectiveId int        not null,
    IsTriggeredByObjective tinyint    null
)
    engine = MyISAM
    charset = utf8;

